import { Component } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { products } from '../products';
import { Product } from '../products';

@Component({
  selector: 'app-products',
  templateUrl: './products.component.html',
  styleUrls: ['./products.component.css']
})
export class ProductsComponent {
  categoryName="";
  constructor(private route: ActivatedRoute, categoryName:string) {
    this.route.params.subscribe(params => {this.categoryName = params['name'];});
  }


  products = products.filter(this.isGreaterThanFive);
  isGreaterThanFive(x: Product) {
    return x.category = this.categoryName;
}
  share() {
    window.alert('The product has been shared!');
  }
  onNotify() {
    window.alert('NOTIFICATION!!!!!');
  }

}
